   <p>Сказачное заморское яство</p>
   <h1 className="card_title">Нямушка</h1>
   <p>{taste}</p>
   <p>{quantity}</p>
   <p>{gift}</p>
   <div>{weight} кг</div>
   </div>
   ;

}
}

export default Card;
